import logo from './logo.svg';
import './App.css';
import Layout from './layout/layout';
import {BrouserRout,Routs,Rout} from './react-router-dom';

function App() {
  return (

   <BrouserRout>
   <Routs>
    <Rout path='/' element={<Layout/>}>

    </Rout>
   </Routs>

   </BrouserRout>
  );
}

export default App;
